import { type } from "os";




function ClientInfo() {

    interface Post {
        name: string;
        phone_number: string;
        id: any | null;
    }
      
    const post: Post = {
        name: "",
        phone_number: "",
        id: ""
    };

    const [data, setData] = useState([]);

    return (
        
        <div>
            {data.map((post: {id: number, name: string, phone_number: string}) =>
                <div key = {post.id}>
                    {post.name}, {post.phone_number} 
                    <TiDelete className='styleIcons' onClick={() => {handleDeleteData(post.id)}}/>
                </div>
            )}
        </div>
    );
}

export default ClientInfo
